import React from 'react';
import earth from './earth.gif';

function Header() {
    return (
      <div>
        {/* Title */}
        <div className = "Header">
          <h1>Defend the Endangered</h1>
          <img src={earth} className="App-logo" alt="logo" />
          <a>Informing the public about<br/>
            the consequences of human interference<br/>
            in nature</a>
        </div>

        {/* Separating bar */}
        <div className = "Header_2">
            <p> header number 2 </p>
        </div>
      </div>
    );
}
export default Header
